1. **Constant Folding**: This technique replaces constant expressions with their computed values at compile time.

   *Before optimization:*
   ```c
   int add(int a, int b) {
       return a + 5 + b;
   }
   ```
   *After optimization:*
   ```c
   int add(int a, int b) {
       return a + 10 + b; // 5 is replaced with 10 at compile time
   }
   ```

2. **Dead Code Elimination (DCE)**: DCE removes code that will never be executed or whose results are never used.

   *Before optimization:*
   ```c
   int foo(int x) {
       int y = x * 2;
       int z = y + 1;
       return z;
   }
   ```
   *After optimization:*
   ```c
   int foo(int x) {
       return x * 2 + 1; // Variable 'y' is eliminated
   }
   ```

3. **Common Subexpression Elimination (CSE)**: CSE replaces multiple occurrences of the same expression with a single occurrence.

   *Before optimization:*
   ```c
   int bar(int a, int b) {
       int x = a + 1;
       int y = b + 1;
       return x * y;
   }
   ```
   *After optimization:*
   ```c
   int bar(int a, int b) {
       int x = a + 1;
       int y = b + 1;
       return x * y; // No change, but the compiler might optimize it further
   }
   ```
   In this case, the compiler might further optimize it by eliminating the common subexpression `(a + 1) * (b + 1)`.

4. **Loop Invariant Code Motion (LICM)**: LICM moves code that is invariant within a loop to before the loop, reducing redundant computations.

